using UnityEngine;

namespace IMGUI.TextureCode
{
	public class TextureCode_SliderHandle : TextureCodeBase
	{
		private static Texture2D tex;
		public static Texture2D Tex => tex == null ? Generate() : tex;
		private static Texture2D Generate()
		{
			tex = new Texture2D(64, 64, TextureFormat.ARGB32, true);
			tex.name = "SliderHandle";
			tex.filterMode = FilterMode.Bilinear;
			tex.wrapMode = TextureWrapMode.Clamp;
			tex.SetPixels(HexToColors(GetHex()));
			tex.Apply();
			return tex;
		}

